import React from 'react'
import { Container } from 'react-bootstrap'

export const TopTematica = ({params}) => {

    console.log(params);

    return (
        <Container>

        <Navbar className='components_topnav'>
            {params.Componentes.map(info => (
                <div>{info.Titulo}</div>
            ))}
        </Navbar>
        </Container>
    )
}
